INSERT INTO `berita` (`id_berita`, `id_kategori`, `username`, `judul`, `judul_seo`, `isi_berita`, `hari`, `tanggal`, `jam`, `gambar`, `dibaca`, `tag`) VALUES
(141, 2, 'admin', 'GKK Mengangkat Ekonomi dan Kesejahteraan Masyarakat', 'gkk-mengangkat-ekonomi-dan-kesejahteraan-masyarakat', '<p>GORONTALO &ndash; Para pengrajin dan mereka yang terkait&nbsp; perdagangan Sulaman Karawo saat ini sedang disibukkan dengan produksi.</p>\r\n\r\n<p>Mereka harus memenuhi permintaan pasar yang terus&nbsp; meningkat, termasuk pesanan dari luar Gorontalo yang terus mengantre.</p>\r\n\r\n<p>&ldquo;Permintaan sulaman karawo makin banyak, ada kenaikan 50 persen sejak digelar festival Gorontalo Karnanal Karawo,&rdquo; kata Nining Abdurahman Arif (35), Ketua Koperasi Wanita Metalik Jaya, Kamis (3/10/2019).</p>\r\n\r\n<p>Untuk memenuhi permintaan ini, ia harus menggerakkan 30 orang anggotanya, para anggota koperani ini juga dibantu keluarganya. Sehingga pekerjaan penyulaman karawo ini sesungguhnya melibatkan banyak orang.</p>\r\n\r\n<p>&ldquo;Memang kewalahan, tapi ini juga menyenangkan semua orang,&rdquo; sambung Nining Abdurrahman Arif.</p>\r\n\r\n<p>Diakuinya, pasar luar daerah semakin terbuka sejak Dinas Pariwisata Provinsi Gorontalo dan Bank Indonesia menggelar Festival Gorontalo Karnaval Karawo. Kaum ibu di luar daerah tertarik dengan sulaman ini melalui media sosial, mereka kemudian memburunya melalui media internet.</p>\r\n\r\n<p>&ldquo;Mereka tertarik karena prosesnya yang rumit, mulai dari pencabutan serat kain, menyulam dan mengikatnya,&rdquo; kata Nining.</p>\r\n\r\n<p>Jilbab adalah pesanan yang paling laris. Bunga-bunga sulaman karawo yang menghias di kain menjadi pemanis siapapun yang memakainya. Pasar jilbab karawo memang sedang bergeliat.</p>\r\n\r\n<p>Jauh dari Ibu Kota Provinsi Gorontalo, Briskawati yanh warga Desa Diloato Kecamatan Paguyaman Kabupaten Boalemo menghentikan pesanan tas karawo hingga 3 bulan ke depan.</p>\r\n\r\n<p>Ia dan pekerjanya tak sanggup lagi memenuhi permintaan pasar, termasuk 400 buah tas karawo pesanan dari Prancis.</p>\r\n\r\n<p>&ldquo;Hingga 3 bulan ke depan kami menghentikan pemesanan, kami masih fokus pada penyelesaian pesanan yang sudah ada,&rdquo; kata Briskawati.</p>\r\n\r\n<p>Seperti sebuah lokomotif kereta api, Festival Gorontalo Karnaval Karawo ini telah membawa gerbong ekonomi para pengrajin melesat. Mereka harus memgikuti irama yang tinggi sambil meningkatkan kualitasnya.</p>\r\n\r\n<p>Di Gorontalo tidak hanya Nining Abdurrahman Arif dan Briskawati, ada ribuan pengrajin yang setiap hari menekuni sulaman ini, mulai dari desainer, pengiris serat kain, dan penyulamnya. Belum terhitung mereka yang terlibat dalam jaringan perdagangannya.</p>\r\n\r\n<p>Yang juga kecipratan kue ini adalah jasa ekspedisi, kuliner, juga penyedia kebutuhan bahan baku.</p>\r\n\r\n<p>Roda ekonomi yang terus membaik dengan tingkat pertumbuhan di atas rata-rata nasional. Salah satu sumbangan geliat ekonomi ini berasal dari sektor pariwisata. Pariwisata Gorontalo memang sedang tumbuh, desa-desa yang memiliki potensi menganggarkan dananya untuk mempercantik diri, mengenalkan river tubing, jungle tracking, hiu paus, tarsius, pantai, mangrove, kuliner, kesenian, adat budaya hingga peninggalan masa lalu.</p>\r\n\r\n<p>Potensi alam dan budaya yang dimiliki desa-desa ini bukan cerita di atas kertas, setidaknya ada 6 desa di kawasan penyangga taman nasional Bogani Nani Wartabonedi Kabupaten Bone Bolango yang mengembangkan ekowisata, juga di Kabupaten Pohuwato, Boalemo, Gorongalo Utara, dan Kabupaten Gorontalo.</p>\r\n\r\n<p>Kekuatan lain yang turut mendukung pengembangan pariiwisata adalah para stakeholder seperti penerbangan, travel, hotel, jasa kepemanduan, dan pelaku usaha ekonomi kreatif. Peran dan kerjasama antarlembaga ini menghasilkan sinergi yang dibutuhkan semua pihak.</p>\r\n\r\n<p>&ldquo;Pariwisata memang menjadi salah satu program unggulan Pemerintah Provinsi Gorontalo. Masyarakat dan pemerintah desa&nbsp; juga sangat antusias mengembangkan potensinya,&rdquo; kata Rifli Katili, Kepala Dinas Pariwisata Provinsi Gorontalo.</p>\r\n\r\n<p>Keseriusan pemerintah menggarap sektor pariwisata ini juga telah mengubah Gorontalo dari daerah transit wisatawan nusantara dan mancanegata menjadi daerah tujuan pariwisata. Namun jumlah kunjungan wisatawan ini harus ditingkatkan agar dapat memberi manfaat lebih beaar lagi kepada masyarakat.</p>\r\n\r\n<p>&ldquo;Gorontalo memiliki hiu paus, burung maleo, tarsius, babi rusa, keramahan warganya, juga adat istiadat yang memperkaya pengalaman hidup para wisatawan mancaneggara dan nusantara,&rdquo; papar Rifli Katili.</p>\r\n\r\n<p>Dinamika ekonomi pariwisata ini menghasilkan multiplier effect, semua yang saling terhubung langsung maupun tidak merasakan peningkatan ekonomi. Inilah pariwisata sebagai lokomotif penarik gerbong ekonomi Gorontalo.</p>\r\n\r\n<p>Dinas Pariwisata menjadi pemicu pertumbuhan ekonomi, di sisi mikronya geliatnya telah meningkatkan pendapatan, mengurangi pengangguran di desa-desa, dan menjalankan pemerataan kesejahteraan sebab pariwisata tidak mengenal desa atau kota, semua layak dikunjungi.</p>\r\n\r\n<p>Namun sejumlah &ldquo;pekerjaan rumah&rdquo; masih menunggu agar pesta akbar pariwisata ini lebih menggema dan memiliki multiplier effect lebih besar. Pekerjaaan yang harus diselesaikan adalah memperpanjang waktu perhelatan dan menautkan dengan festival lain di kabupaten dan kota di daerah ini, seperti Festival Pesona Danau Limboto, Festival Pesona Otanaha, Festival Pesona Saronde, Festival Pohon Cinta, dan lainnya</p>\r\n\r\n<p>Mengintegrasikan banyak festival ini tidak mudah, namun juga bukan tidak bisa. Koordinasi dan kerja sama terus menjadi jembatan komunikasi agar bisa terwujud, semuanya demi peningkatan pertumbuhan ekonomi, pengurangan pengangguran, dan peningkatan kesejahteraan masyarakat.</p>\r\n\r\n<p>&ldquo;Kami memiliki brand Gorontalo the Heart of Celebes yang menegaskan potensi besar pada kekayaan keanekaragaman hayati dan budaya, inilah pariwisata yang berkelas internasional,&rdquo; kata Ivone Reane Larekeng, Kepala Bidang Pemasaran Pariwisata.</p>\r\n', 'Minggu', '2017-11-19', '14:20:16', '13Untitled-1-2.jpg', 1, ''),
(142, 2, 'admin', 'Membina Siswa SD Untuk Melestarikan Budaya Sulam Karawo', 'membina-siswa-sd-untuk-melestarikan-budaya-sulam-karawo', '<p>GORONTALO &ndash; Farel (11) siswa SD Muhammadiyah, Kota Utara, Kota Gorontalo baru 2 hari mengiris serat lain untuk membuat sulaman karawo. Berbekal midangan, kain, jarum dan silet ia pilih serat kain yang hendak dipotong.</p>\r\n\r\n<p>Sesekali seorang wanita paruh baya mengarahkan cara yang mudah untuk mengiris serat agar tidak rusak. Farel tidak sendiri, ada Nurfadila (12), dan Nisa (9) dan seorang gadis kecil yang juga sama-sama pakai seragam sekolah, mereka bergantian melakukan pengirisan, penyulaman dan mengikat serat kain.</p>\r\n\r\n<p>Siswa sekolah dasar ini sedang menyelesaikan pola motif geometris di ajang Mokarawo Traditional Handmade atau lomba mengiris, menyulam dan mengikat yang diikuti banyak kelompok wanita pengrajin sulam karawo.</p>\r\n\r\n<p>Para siswa ini tidak ikut lomba, keterampilan ini adalah eksibisi untuk memeriahkan Mokarawo Traditional Handmade di Bele li Mbui, salah satu rangkaian Gorontalo Karnaval Karawo (GKK).</p>\r\n\r\n<p>&ldquo;Kami hanya memperlihatkan bahwa pembinaan sulaman karawo pada anak-anak ini benar-benar kami lakukan,&rdquo; kaya Delvi Akase, staf Dinas Perindustrian Kota Gorontalo, Jumat (4/10/2019).</p>\r\n\r\n<p>Delvi Akase menjelaskan sejak 2 tahun Pemerintah Kota Gorontalo melalui Dinas Perindustrian memprogramkan pembinaan sulaman karawo pada siswa sekolah dasar. Diakuinya oembinaan ini tidak intensif dengan mengenalkan kemampuan dasar membuat sulaman seperti mengiris serat lain, menyulam dan mengikat. Pekerjaannya pun masih sekitas pembuatan pola yang sederhana.</p>\r\n\r\n<p>&ldquo;Kami senang membuat karawo, tidak susah tapi juga tidak boleh cepat-cepat,&rdquo; kata Farel.</p>\r\n\r\n<p>Mokarawo Traditional Handmade merupakan bagian dari pesta besar Gorontalo Karnaval Karawo, salah satu dari&nbsp; 100 Calendar of Event Kementerian Pariwisata.</p>\r\n\r\n<p>Dalam lomba ini diikuti puluhan peserta dari kelompok-kelompok usaha sulam karawo di Gorontalo.</p>\r\n\r\n<p>&ldquo;Kami terus mendorong tumbuh kembangnya kerajinan tradisional Gorontalo ini melalui bidang Ekonomi Kreatif,&rdquo; kata Rifli Katili, Kepala Dinas Pariwisata Provinsi Gorontalo.</p>\r\n\r\n<p>Upaya pemuliaan kerajinan ini dilalukan dengan pembinaan dan pelatihan, yang pada akhir kegiatan adalah pesta kaum pengrajin karawo, Gorontalo Karnaval Karawo.</p>\r\n\r\n<p>Tekad Pemerintah Provinsi Gorontalo melalui Dinas Pariwisata dalam memajukan kerajinan ini dilalukan dengan kolaborasi dengan berbagai instansi seperti Bank Indonesia dan Dinas Perindustrian.</p>\r\n\r\n<p>&ldquo;Gorontalo Karnaval Karawo adalah sarana mengenalkan sulaman ini kepada dunia,&rdquo; kata Ivone Reane Larekeng, Kepala Bidang Pemasaran Pariwisata.</p>\r\n\r\n<p>Ivone Larekeng yakin, upaya mengenalkan sulaman tradisional ini terus dilalukan melalui banyak cara, menggelar festival, promosi online dan offline dan jalur lainnya.</p>\r\n', 'Minggu', '2017-11-19', '14:22:12', '79Diskotik-1-960x720.jpg', 1, ''),
(143, 2, 'admin', 'Lomba Sulam Karawo Pacu Pengrajin Tingkatkan Kualitas', 'lomba-sulam-karawo-pacu-pengrajin-tingkatkan-kualitas', '<p>GORONTALO &ndash; Salah satu bagaian Calendar of Event Kementerian Pariwisata, Gorontalo Karnaval Karawo (GKK) dilaksanakan oleh Dinas Pariwisata Provinsi Gorontalo bekerja sama dengan Kantor Perwakilan Bank Indonesia dalam satu rangkaian acara yang terpadu.</p>\r\n\r\n<p>Kegiatan hari ketiga pelaksaan GKK adalah lomba meyulam atau Mokarawo Traditional Handmade yang dilaksanakan di Bele li Mbui, Kota Gorontalo, Jumat (4/10/2019).</p>\r\n\r\n<p>Selain untuk mempromosikan Karawo sebagai sulaman khas Gorontalo, ajang bergengsi ini juga sebagai wahana untuk menggali kreativitas pengrajin.</p>\r\n\r\n<p>Sekretaris Daerah Provinsi Gorontalo, Darda Daraba yang membuka kegiatan ini mengatakan, lomba menyulam karawo merupakan sarana mengajak pengrajin untuk meningkatkan keterampilan, mulai dari mendesain, mengiris serat kain, menyulam, dan mengikat.</p>\r\n\r\n<p>&ldquo;Keempatnya ini pasti membutuhkan keterampilan. Kalau keterampilan ini selalu di asah terus menerus maka karawo ini saya pastikan tidak kalah dengan kain kain lainnya,&rdquo; kata Darda Daraba.</p>\r\n\r\n<p>Darda berharap perlombaan ini bisa memberikan efek baik bagi pengembangan sulaman karawo di desa-desa dan perkotaan..</p>\r\n\r\n<p>&ldquo;Kalau ini bisa bagus, dapat meningkatkan keterampilan, bisa memperlihatkan hasil yang memuaskan. Tentunya kalau dipasarkan bisa laku di pasar lokal maupun internasional yang dampaknya meningkatkan kesejahteraan masyarakat Gorontalo,&rdquo; kata Darda Daraba.</p>\r\n\r\n<p>Sementara itu, Kepala Dinas Pariwisata Rifli Katili mengatakan lomba MoKarawo Tradisional Handmade ini merupakan kegiatan yang ke-empat dari rangkaian pelaksanaan Gorontalo Karnaval Karawo 2019 yang mengusung tema &ldquo;Wonderful Celebes&rdquo;.</p>\r\n\r\n<p>Kegiatan ini diharapkan agar para pengrajin ini menemukan pola yang baru sesuai dengan kebutuhan pasar dan layak untuk dijual. Karena Karawo ini tidak lagi milik orang Gorontalo tapi sudah meluas hingga ke mancanegara.</p>\r\n\r\n<p>&ldquo;Karawo menjadi kebanggaan untuk kita semua,&rdquo; ujar Rifli Katili.</p>\r\n\r\n<p>Rifli Katili mengatakan, ada yang menarik dari lomba ini, selain diikuti 44 pengrajin Karawo dari kabupaten/kota se-Provinsi Gorontalo, kegiatan ini juga mengikutsertakan anak-anak Sekolah Dasar dan SMK.</p>\r\n\r\n<p>&ldquo;Mereka (anak sekolah) bukan peserta tapi diikutkan untuk memotivasi anak-anak yang tujuannya agar mereka punya inovasi , kreativitas dan tidak terpaku pada motiv dan pola yang lama,&rdquo; ujar Rifli Katili.</p>\r\n\r\n<p>Untuk penilaian lomba ini dilihat dari aspek keindahan mengiris, keindahan menyulam dan keindahan mengikat.</p>\r\n', 'Minggu', '2017-11-19', '14:24:25', '62Karawo-960x640.jpg', 1, ''),
(144, 2, 'admin', 'Gorontalo Ditantang Menteri Pariwisata Bangun KEK Pariwisata', 'gorontalo-ditantang-menteri-pariwisata-bangun-kek-pariwisata', '<p>GORONTALO &ndash; Menteri Pariwisata Arief Yahya menantang Gubernur Gorontalo Rusli Habibie untuk membuat Kawasan Ekonomi Khusus (KEK) Pariwisata. KEK menurutnya merupakan solusi terbaik jika Gorontalo ingin menjadi pariwisata sebagai program dan destinasi unggulan.</p>\r\n\r\n<p>Arief menilai pengembangan pariwisata di Indonesia terkendala dalam aspek birokratisasi yang berbelit-belit. Selain itu masalah pembebasan lahan juga sering menjadi kendala sebelum dinyatakan clear dan clean.</p>\r\n\r\n<p>&ldquo;Jadi KEK adalah salah satu solusi untuk tiga hal. Pertama birokratisasi, kedua perizinan satu pintu dan ketiga cara cerdas (suatu daerah mengembangkan pariwisata) menurut saya,&rdquo; ungkap Arief saat menghadiri rangkaian acara Gorontalo Karnaval Karawo (GKK) 2019 di Hotel Grand Q, Kota Gorontalo, Sabtu (5/10/2019).</p>\r\n\r\n<p>Dengan penetapan KEK pariwisata, banyak kemudahan yang didapatkan daerah dari pemerintah pusat. Infrastruktur dasar serta infrastruktur pendukungnya akan disiapkan seperti pembangunan jalan, listrik, air bersih dan internet. Menpar mencontohkan KEK Mandalika di Nusa Tenggara Barat.</p>\r\n\r\n<p>&ldquo;Mandalika itu satu jam dari bandara. Kita buatkan jalan byepass 18 kilo sekarang jarak tempuhnya kurang dari 30 menit,&rdquo; imbuhnya.</p>\r\n\r\n<p>KEK di Gorontalo diharapkan menjadi&nbsp;primary destination. Destinasi lain di daerah tersebut akan menjadi kawasan pendukung sehingga pariwisata dapat terintegrasi dengan baik. Hal itu tidak saja meningkatkan jumlah destinasi wisatawan, tetapi juga menambah lama tinggal wisatawan.</p>\r\n\r\n<p>Pemprov Gorontalo melalui Bapppeda sedang mengusulkan obyek wisata Lombongo menjadi Kawasan Ekonomi Khusus (KEK). Sayangnya usulan tersebut terkendala luas lahan yang dipersyaratkan minimal 120 hektar. Luas lahan Lombongo hanya lebih kurang 32 hektar.</p>\r\n\r\n<p>Kedatangan Menpar di Gorontalo untuk menjadi pembicara pada Celebes Tourism Meeting dalam rangkaian GKK 2019. Forum itu diikuti oleh Gubernur Gorontalo Rusli Habibie, Wakil Gubernur Idris Rahim, para kepala daerah kabupaten/kota serta pelaku pariwisata.</p>\r\n\r\n<p>Forum tersebut juga menghadirkan Wagub Sulawesi Tengah Rusli Daeng Palabbi serta Bupati Banyuwangi Abdullah Azwar Anas selaku pembicara.</p>\r\n\r\n<p>Rencananya Manpar juga akan menghadiri puncak Gorontalo Karnaval Karawo 2019 bertempat di depan rumah jabatan gubernur pada Minggu 6 Oktober besok. GKK menjadi satu dari 100 kalender event pariwisata nasional tahun 2019.</p>\r\n', 'Minggu', '2017-11-19', '14:25:41', '11Diskotik-2-960x639.jpg', 1, ''),
(145, 2, 'admin', 'Pengembangan Pariwisata Harus Gunakan Konsep 3A', 'pengembangan-pariwisata-harus-gunakan-konsep-3a', '<p>LOMBONGO &ndash; Menteri Pariwisata RI Arief Yahya menegaskan bahwa untuk pengembangan pariwisata di Provinsi Gorontalo harus menggunakan konsep 3A, yaitu Akses, Amenitas, dan Atraksi. Hal itu disampaikannya saat berkunjung ke objek wisata alam Lombongo di Kabupaten Bone Bolango (Bonebol), Minggu (6/10/2019).</p>\r\n\r\n<p>&ldquo;Atraksinya Gorontalo sudah sangat bagus, tarian, budaya, dan alamnya bagus. Setelah kunjungan ke Lombongo ini saya lebih yakin lagi untuk atraksi sudah tidak ada masalah,&rdquo; ujar Menpar Arief Yahya.</p>\r\n\r\n<p>Untuk akses pariwisata, Menpar meminta agar pemasaran pariwisata Gorontalo dilakukan dengan menjadikan Manado sebagai penghubung. Menurutnya hal tersebut sudah menjadi kelaziman untuk memajukan satu destinasi wisata. Sedangkan untuk amenitas atau kemudahan, Arief menginstruksikan jajaran pariwisata di Provinsi Gorontalo untuk bekerja sama dengan maskapai penerbangan.</p>\r\n\r\n<p>&ldquo;Dulu Lombok menjadi Bali sebagai penghubung, demikian juga dengan Banyuwangi. Saya minta juga kepada rekan-rekan biro perjanalan wisata di Manado untuk mempromosikan destinasi wisata di Gorontalo. Bangun kerja sama dengan airline, kalau pakai darat waktunya terlalu lama,&rdquo; imbuhnya.</p>\r\n\r\n<p>Sementara itu terkait pengembangan Kawasan Ekonomi Khusus (KEK) pariwisata di Kabupaten Bonebol yang akan diajukan ke Kemenpar, Wakil Gubernur Idris Rahim yang turut mendampingi Menpar Arief Yahya mengutarakan bahwa Pemprov Gorontalo sepenuhnya akan bersinergi mendukung hal tersebut. Berdasarkan aturan Kemenpar, minimal kawasan pengembangan pariwisata seluas 100 hektar.</p>\r\n\r\n<p>&ldquo;Di kawasan Lombongo ini ada lahan milik Pemprov Gorontalo dengan luas kurang lebih 32 hektar. Ini bisa kita masukkan dalam KEK pariwisata di Bone Bolango, secepatnya akan kita bahas bersama,&rdquo; tutur Wagub Idris Rahim.</p>\r\n\r\n<p>Pada kunjungannya ke objek wisata alam Lombongo, Menpar Arief Yahya bersama Wagub Idris Rahim dan sejumlah pejabat dari Kemenpar berkesempatan untuk melepas anak burung Maleo ke alam bebas hasil pengembangbiakkan oleh Balai Taman Nasional Bogani Nani Wartabone. Sebelumnya kedatangan Menpar bersama rombongan disambut dengan upacara adat yang seluruh pelaksananya ada para siswa Sekolah Dasar.</p>\r\n', 'Minggu', '2017-11-19', '14:28:36', '97Diskotik-3.jpg', 1, ''),
(146, 2, 'admin', 'Wonderful Celebes Pukau Pengunjung Gorontalo Karnaval karawo', 'wonderful-celebes-pukau-pengunjung-gorontalo-karnaval-karawo', '<p>GORONTALO &ndash; Pemerintah Provinsi Gorontalo kembali menggelar Gorontalo Karnaval Karawo (GKK) 2019 bertempat di depan rumah jabatan gubernur, Minggu (6/10/2019). Event yang masuk 100 kalender pariwisata nasional itu berlangsung meriah dengan karnaval busana karawo berbagai tema budaya daerah.</p>\r\n\r\n<p>GKK 2019 dibuka oleh Menteri Pariwisata Arief Yahya didampingi Wakil Gubernur Gorontalo Idris Rahim. Sejumlah pejabat eselon I dan II Kementrian Pariwisata serta para kepala daerah se Gorontalo ikut hadir.</p>\r\n\r\n<p>Event tahunan kali ini mengambil thema &ldquo;Wonderful Celebes&rdquo; atau pesona Sulawesi. Pulau Sulawesi sendiri dikenal dengan kekayaan alam dan budayanya. Contohnya dari Biro Humas dan Protokol mengambil tema Sulawesi Utara dengan Kota Bunga Tomohon yang artinya dikenal sebagai salah satu kota penghasil bunga terbesar di Indonesia. Inilah mengapa Kota Tomohon harus dikunjungi wisatawan.</p>\r\n\r\n<p>Adapula Badan Keuangan Provinsi Gorontalo mengambil tema, Sulawesi Selatan. Sulawesi Selatan memiliki keanekaragaman budaya dan kearifan lokal yang Indah. Salah satu di antaranya adalah Bantimurung yang menjadi surga bagi ribuan spesies kupu-kupu</p>\r\n\r\n<p>Dalam sambutannya Arief Yahya menyampaikan, GKK sudah dua tahun berturut-turut masuk dalam kalender top 100 even nasional. Hal ini tentu saja sangat membanggakan, mengingat masuk ke kalender tersebut sangatlah susah harus bersaing dengan seluruh daerah se Indonesia.</p>\r\n\r\n<p>&ldquo;Mengenai event Gorontalo salah satu provinsi yang banyak eventnya. Di Gorontalo ada 82 event, jarang sekali satu provinsi ada event sebanyak itu dan bahkan ada dua event yang masuk dalam kalender nasional yaitu Festival Karawo dan Festival Pesona Danau Limboto,&rdquo; kata Arief Yahya.</p>\r\n\r\n<p>Arief Yahya menambahkan mengenai tema yang dipilih sangat bagus yakni wonderful Celebes atau pesona Sulawesi. Menurutnya, dibalik semua itu daerah bagian Sulawesi mempunyai tujuan yang sama &ldquo;Sulawesi bersatu&rdquo; dalam bingkai NKRI.</p>\r\n\r\n<p>Sementara itu Wakil Gubernur Gorontalo Idris Rahim atas nama Pemprov Gorontalo mengucapkan terimakasih kepada semuah pihak utamanya Menteri Pariwisata RI yang sudah bersedia meluangkan waktu untuk hadir dan membuka langsung kegiatan GKK 2019 ini. Ia berharap event ini akan terus eksis dan meningkatkan daya tarik agar wisatawan yang berkunjung ke Gorontalo semakin banyak.</p>\r\n\r\n<p>&ldquo;Karena kegiatan ini sekaligus pula mendukung program perencanaan nasional, di bidang pariwisata untuk mencapai kunjungan wisatawan mancanegara sebanyak 20 juta orang dan wisatawan lokal dengan 375 juta orang, pada tahun 2020 nantinya,&rdquo; tutur Idris Rahim.</p>\r\n', 'Minggu', '2017-11-19', '21:58:36', '68Diskotik-4-960x640.jpg', 1, ''),
(147, 2, 'admin', 'Biro Humas Protokol Tampil Flora Tomohon di GKK', 'biro-humas-protokol-tampil-flora-tomohon-di-gkk', '<p>GORONTALO &ndash; Biro Humas Protokol Provinsi Gorontalo tampil memukau pada pagelaran Gorontalo Karnaval Karawo 2019, Minggu (06/10/2019).</p>\r\n\r\n<p>Penampilan memukau tersebut terlihat dari antusias masyarakat yang hadir dan antri untuk berswafoto dengan peserta dari Biro Humas Protokol yang tahun ini mengangkat tema Kota Bunga Tomohon.</p>\r\n\r\n<p>&ldquo;Saya pribadi sangat puas dengan apa yang ditampilkan oleh Biro Humas dan Protokol pada hari ini. Dengan penampilan yang sangat cantik dan ciamik menampilkan keindahan bunga yang menjadi representasi dari Kota Tomohon. Maka tidak salah kalau tadi saya perhatikan juga mereka menjadi objek swafoto dari masyarakat yang hadir,&rdquo; ungkap Kepala Biro Humas Protokol Masran Rauf saat diwawancarai via telepon.</p>\r\n\r\n<p>Mengacu pada tema utama GKK 2019 yakni Wonderfull Celebes, Kota Bunga Tomohon sengaja dipilih untuk memperkenalkan kepada khalayak bahwa Tomohon adalah salah satu kota penghasil bunga-bunga indah di Indonesia.</p>\r\n\r\n<p>&ldquo;Sengaja kami pilih Kota Bunga Tomohon karena kan selama ini Sulawesi itu hanya dikenal dengan keindahan bawah lautnya, makanya kita angkat bunga-bunga ini untuk menunjukkan juga bahwa Sulawesi Utara khususnya Tomohon punya potensi lain, yakni sebagai Kota Bunga,&rdquo; ungkap Ferdi Adam selaku Kepala Bagian Pengolahan Data dan Kemitraan Media Biro Humas Protokol.</p>\r\n\r\n<p>Masih menurut Ferdi, persiapan yang dilakukan memakan waktu selama dua minggu. Mulai dari menyiapkan kostum, aksesoris, sinopsis dan koreografi. Seluruh kebutuhan tim disiapkan oleh personil Biro Humas Protokol.</p>\r\n\r\n<p>GKK 2019 telah masuk dalam 100 calendar of event Kementrian Pariwisata Republik Indonesia. Perhelatan tersebut dihadiri dan dibuka oleh Menteri Pariwisata RI Arief Yahya. Sebanyak 32 peserta dari berbagai daerah ikut memeriahkan event ini.</p>\r\n', 'Minggu', '2017-11-19', '22:01:20', '18Diskotik-5-960x640.jpg', 1, ''),
(148, 2, 'admin', 'Menteri Pariwisata Apresiasi Gorontalo Karnaval Karawo', 'menteri-pariwisata-apresiasi-gorontalo-karnaval-karawo', '<p>GORONTALO&nbsp; &ndash; Menteri Pariwisata Arief Yahya mengakui semangat penyelenggaraan Gorontalo Karnaval Karawo yang bergelora.</p>\r\n\r\n<p>Menpar mengakui dalam instagramnya yang diunggah pada saat karnaval karawo berlangsung di depan rumah dinas gubernur Gorontalo, Minggu (6/10/2019).</p>\r\n\r\n<p>Lebih dari 500 orang penampil dengan baju yang bertema Wonderful Celebes menyuguhkan atraksi yang mengundang decak kagum ribuan orang yang memadati jalur lebih 2 km.</p>\r\n\r\n<p>Arief Yahya beserta jajaran menghadiri pelaksanaan kegiatan Calendar of Event di Kota Gorontalo, Provinsi Gorontalo.</p>\r\n\r\n<p>Karnaval Gorontalo Karawo 2019 dilaksanakan dengan tema Wonderful Celebes sudah tahun kedua masuk dalam Top-100 Calendar of Events Nasional.</p>\r\n\r\n<p>Acara tersebut juga dihadiri oleh&nbsp; Idris Rahim, Wakil Gubernur Gorontalo, Budi Widi Hartanto, Kepala Perwakilan BI Gorontalo, dan Bupati Walikota di wilayah Provinsi Gorontalo.</p>\r\n\r\n<p>Karawo adalah sulaman tradisional khas Gorontalo yang pembuatannya merupakan hasil kerajinan tangan yang nama tersebut diambil dari Bahasa Gorontalo yang artinya sulaman dengan tangan.</p>\r\n\r\n<p>Festival Karawo adalah salah satu festival yang bertujuan mempopulerkan sulaman khas Gorontalo yang digelar setiap tahun di Kota Gorontalo. Festival ini pertama kali digelar pada 17 &ndash; 18 Desember 2011.</p>\r\n\r\n<p>Festival Karnaval Karawo biasanya dimeriahkan dengan pameran kerajinan karawo, parade dan peragaan busana karawo yang diikuti pemerintah daerah, perbankan dan pelaku usaha.</p>\r\n\r\n<p>Festival ini juga melibatkan ratusan hingga ribuan orang baik dari kalangan pelajar, pemerintah setempat dan masyarakat umum. Gorontalo Karnaval&nbsp; Karawo 2018 adalah salah satu Kalender Event Pariwisata Nasional.</p>\r\n\r\n<p>Dalam rangka mempromosikan&nbsp; kreatif desain karawo dan diharapkan memiliki daya tarik wisata untuk menigkatkan kunjungan wisatawan nusantara dan mancanegara. Dan pada tahun 2018 event ini masuk dalam 100 event VIWI (Visit Indonesia Wonderful Indonesia).</p>\r\n\r\n<p>Dalam sambutannya, Menpar Arief Yahya menyampaikan beberapa arahan, di antaranya adalah apresiasi untuk jumlah event yang sudah banyak di Provinsi Gorontalo.</p>\r\n\r\n<p>Jumlah total events Provinsi Gorontalo tahun 2019: 82 Events. 2 Events masuk Top 100 CoE: Festival Pesona Danau Limboto (21-25 September 2019) dan Gorontalo Karnaval Karawo (2-6 Oktober 2019).</p>\r\n\r\n<p>Selain itu, Menpar juga menyampaikan mengenai pentingnya kriteria 3C, di antaranya adalah Creative Value, yaitu Koreografi (memanfaatkan panggung yang besar, cameragenic), Desainer dan Aransemen yang terbaik. Kedua adalah Commercial Value, yang terdiri atas jumlah wisatawan, media value, dan multiplier effect. Poin ketiga adalah Commitment CEO yang menekankan pentingnya komitmen kepala daerah untuk pengembangan event, terutama komitmen anggaran.</p>\r\n', 'Minggu', '2017-11-19', '22:06:54', '51Diskotik-6.jpg', 1, ''),
(149, 2, 'admin', 'KEK Pariwisata Percepat Pertumbuhan Ekonomi Gorontalo', 'kek-pariwisata-percepat-pertumbuhan-ekonomi-gorontalo', '<p>GORONTALO &ndash; Gorontalo memerlukan Kawasan Ekonomi Khusus (KEK) Pariwisata untuk mempercepat pertumbuhan ekonomi daerah.</p>\r\n\r\n<p>Kawasan ini minimal seluas 120 ha agar para investor lebih leluasa melakukan investasinya dengan dukungan layanan yang mudah dan cepat.</p>\r\n\r\n<p>&ldquo;Jika ada Kawasan Ekonomi Khusus Pariwisata maka akan ada debirokratisasi, pengurusan izin tidak berbelit-belit,&rdquo; kata Menteri Pariwisata, M Arief Yahya, di depan Wakil Gubernur Idris Rahimz Bupati Bone Bolango Hamim Pou dan sejumlah pejabat, Minggu (6/10/3019).</p>\r\n\r\n<p>Menteri Pariwisata juga menjelaskan pemerintah akan menggelontorkan dukungan anggaran hingga Rp32 Triliun untuk menghidupkan kawasan khusus ini.</p>\r\n\r\n<p>Masuknya anggaran ini akan memberi kemudahan bagi pemerintah daerah dalam menghidupkan ekonomi.</p>\r\n\r\n<p>&ldquo;Ini cara cerdik agar pemerintah pusat membantu pemerintah daerah,&rdquo; papar M Arief Yahya.</p>\r\n\r\n<p>Dalam kawasan ini juga layanan investor makin sederhana, tidak dipersulit dan berbelit-belit. Pelayanan 1 pintu ini membuat investor tidak ditendang sana-sini dalam pengurusan izin.</p>\r\n\r\n<p>Direncanakan kawasan ekonomi khusus ini berada di sekitar Lombongo, namun luasannya masih belum optimal.</p>\r\n\r\n<p>Sebagai pendatang baru dalam dunia pariwisata, Gorontalo memiliki potensi yang besar, terutama untuk lasar wisata eropa dan amerika.</p>\r\n\r\n<p>Kekayaan biodiversitas&nbsp; budaya budaya menjadi suguhan utama wisatawan selain obyek wisata buatan.</p>\r\n\r\n<p>Gorontalo berada di wilayah bioekoregion Wallacea yang memiliki endemisitas tinggi.</p>\r\n\r\n<p>Kekhasan kekayaan keanekaragaman yang unik, antara dua wilayah, Asia dan Australia dapat dinikmati wisatawan mancanegara.</p>\r\n\r\n<p>Kepala Dinas Pariwisata Provinsi Gorontalo, Rifli Katili, menjelaskan pembangunan pariwisata di Gorontalo saat ini melakukan pendekatan 3A, Atraksi, Akses dan Amenitas sebagaimana konsep kementerian pariwisata.</p>\r\n\r\n<p>&ldquo;Pariwisata adalah salah satu dari 8 program unggulan Pemerintah Provinsi Gorontalo. Dengan pariwisata perekonomian akan tumbuh naik, mengurangi pengangguran dan meningkatkan pendapatan masyarakat,&rdquo; kata Rifli Katili.</p>\r\n', 'Minggu', '2017-11-19', '22:13:10', '52Diskotik2-960x720.jpg', 1, ''),
(150, 2, 'admin', 'Pemangku Kepentingan Pariwisata Bersepakat Gelar Promosi Kolaboratif', 'pemangku-kepentingan-pariwisata-bersepakat-gelar-promosi-kolaboratif', '<p>GORONTALO &ndash; Dinas Pariwisata Provinsi Goronalo menggelar Refleksi Akhir Tahun dan Rapat Koordinasi dengan sejumlah pemangku kepentingan bidang pariwisata di aula dinas, Rabu (18/12/2019).</p>\r\n\r\n<p>Pertemuan yang dipimpin Rifli Katili, Kepala Dinas Pariwisata Provinsi Goronalo ini dihadiri Asosiasi Industri Pariwisata, maskapai penerbangan, dan akademisi pariwisata.</p>\r\n\r\n<p>&ldquo;Tujuan pertemuan ini untuk meminta masukan dan saran para pelaku Asosiasi Industri Pariwisata terkait data kunjungan selama tahun 2019,&rdquo; kata Rifli Katili.</p>\r\n\r\n<p>Rifli Katili menjelaskan jumlah kunjungan wisatawan yang ditargetkan sebesar 671.000 orang pada tahun 2019 jika dibandingkan dengan tahun 2018 yang mengalami penurunan lebih dari 50 persen.</p>\r\n\r\n<p>Selain itu Rifli Katili merencanakan menggelar rapat koordinasi dengan dinas pariwisata kabupaten/kota untuk menyamakan dan mensinkronkan program dan kegiatan serta melakukan kolaborasi mengenai paket wisata di tahun mendatang.</p>\r\n\r\n<p>Dalam pertemuan ini sejumlah masukan dilontarkan oleh peserta rapat, Purwanto Gunawan dari Hotel Grand Q Hotel meminta perlu adanya paket wisata yang ditawarkan kepada wistaawan. Menurunnnya kunjungan wisata ini diduga tidak tersedianya paket wisata dan harga tiket yang mahal.</p>\r\n\r\n<p>&ldquo;Promosi yang gencar juga harus dilakukan pemerintah, minimal setahun sekali dengan melibatkan para pelaku usaha wisata,&rdquo; kata Komang Suherta dari Hotel Horizon.</p>\r\n\r\n<p>Komang Suherta juga mengharapkan agar pelaku usaha perhotelan setiap tahun diberikan Calender of&nbsp; Event sehingga dapat mempromosikan pariwisata ke luar daerah maupun keluar negeri.</p>\r\n\r\n<p>Dari pertemuan yang melbatkan banyak pemenku kepentingan ini, Dinas Pariwisata mengharapkan adanya langkah konkrit untuk mengintegraskan pentahelix yang harus dikuatkan oleh masing&ndash;masing pihak dengan menggelar pertemuan 3 bulan sekali.</p>\r\n\r\n<p>&ldquo;Kesepakatan pertemuan pertama akan dilaksanakan di Hotel Grand Q, dan untuk perencanaan kegiatan besar akan melibatkan Asosiasi Industri Pariwisata, stakeholder terkait serta masyarakat,&rdquo; kata Rifli Katili.</p>\r\n\r\n<p>Yang menarik dalam pertemuan ini adalah kesepakatan untuk membuat paket wisata yang dipromosikan bersama-sama (kolaborasi).</p>\r\n\r\n<p>Pewarta : Hesty Kurniawaty &ndash; Dispar</p>\r\n\r\n<p>Sumber : www.gorontaloprov.go.id</p>\r\n', 'Minggu', '2017-11-19', '22:16:18', '67c16ea4ed65c7d5880e1b493a5f5042ba_XL-960x720.jpg', 1, ''),
(151, 2, 'admin', 'Dinas Pariwisata Gelar FGD Strategi Pengembangan Pemasaran Pariwisata', 'dinas-pariwisata-gelar-fgd-strategi-pengembangan-pemasaran-pariwisata', '<p>GORONTALO &ndash; Sejumlah pemangku kepentingan dunia pariwisata pariwisata hadir dalam diskusi terpumpun atau Focus Discussion Group strategi pengembangan pemasaran pariwisata Gorontalo di Hotel Damhil, Kampus Universitas Negeri Gorontalo, Jumat (17/1/2020).</p>\r\n\r\n<p>Diskusi ini dibuka oleh Plh Sekretaris Daerah, Sukri Botutihe, dengan menghadirkan pembicara M Nurdin Razak pakar ecotorism dan M Yusuf Dino Gobel Staf Khusus Gubernur Sulawesi Utara Bidang Pariwisata.</p>\r\n\r\n<p>Selain itu hadir Kepala Perwakilan Kantor Bank Indonesia, Kepala Dinas Pariwisata Kabupaten Kota, Bappeda Provinsi Gorontalo, BKSDA, BPDAS, Balai TNBNW,&nbsp; Perkumpulan Biota serta pelaku industri pariwisata lainnya.</p>\r\n\r\n<p>Dalam sambutannya, Sukri Botutihe menegaskan Pemerintah Provinsi Gorontalo telah menjadikan pariwisata sebagai program unggulan pembangunan yang diharapkan mampu menumbuhkan ekonomi dan sebagai sarana menyejahterakan masyarakat.</p>\r\n\r\n<p>&ldquo;Kami mengapresiasi diskusi ini sebagai bentuk keseriusan pengembangan pariwisata Gorontalo terutama wisata minat khusus/ecotourism dan mass tourism,&rdquo; kata Sukri Botutihe.</p>\r\n\r\n<p>Kepala Dinas Pariwisata, Rifli Katili menambahkan kolaborasi pemerintah provinsi dengan pemerintah kabupaten kota menjadi hal yang sangat penting dalam pengembangan pariwisata Gorontalo, dan ke depannya dibutuhkan langkah strategis, kolaborasi ini juga melibatkan juga tenaga ahli di bidang pariwisata agar semuanya lebih terarah dan terstruktur.</p>\r\n\r\n<p>Kegiatan ditutup dengan penanda tanganan MOU Pengembangan pemasaran pariwisata dan Visit Gorontalo 2020 antara Dinas Pariwisata Provinsi Gorontalo dengan Dinas Pariwisata Kabupaten Kota Se Provinsi Gorontalo.</p>\r\n\r\n<p>Pewarta : PPID Dispar</p>\r\n\r\n<p>Sumber : www.gorontaloprov.go.id</p>\r\n', 'Minggu', '2017-11-19', '22:20:07', '78gambar 23.jpg', 1, ''),
(152, 2, 'admin', 'Rakor Pariwisata Tekankan Peningkatan Kualitas SDM', 'rakor-pariwisata-tekankan-peningkatan-kualitas-sdm', '<p>GORONTALO &ndash; Dinas Pariwisata Provinsi Gorontalo menggelar rapat koordinasi awal tahun dalam rangka evaluasi &nbsp;program tahun anggaran 2019 dan sinkronisasi program tahun 2020, Kamis (23/1/2020).</p>\r\n\r\n<p>Rapat dipimpin Rifli Katili, Kepala Dinas Pariwisata Provinsi Gorontalo dan dihadiri sekretaris, kepala bidang dan kepala Seksi, kasubag program. Dari kabupaten/kota juga hadir para kepala dinas, kepala bidang dan kepala seksi, kasubag program.</p>\r\n\r\n<p>Dalam pembahasan rapat ini ditekankan pada upaya peningkatan kualitas Sumber Daya Manusia (SDM) yang bergerak di bidang pariwisata, baik di pemerintahan maupun di swasta, termasuk masyarakat yang berada di obyek wisata.</p>\r\n\r\n<p>Secara kelembagaan dan SDM, Rifli Katili mengakui SDM yang ada di dinas maupun yang bergerak di sektor pariwisata masih lemah, termasuk animo masyarakat di sekitar destinasi wisata menjadi tantangan besar tersendiri.</p>\r\n\r\n<p>&ldquo;Kami mengajak dinas pariwisata kabupaten/kota untuk bersinergi dengan mitra di industri pariwisata. Saat dinas pariwisata menyelenggarakan kegiatan maka mereka akan jalan dengan paket wisatanya,&rdquo; kata Rifli Katili.</p>\r\n\r\n<p>Rifli Katili mengungkapkan persoalan mendasar pariwisata Gorontalo adalah pemasaran. Pada masa kepemimpinan Menteri Pariwisata Arief Yahya bisa dilihat lebih dari 60 persen anggaran Kementerian Pariwisata untuk pemasaran dan promosi.</p>\r\n\r\n<p>&ldquo;Harus diakui prestasi luar biasa yang dicapai Kementerian Pariwisata di level nasional dan internasional dengan promosi yang gencar, pendapatan sektor pariwisata bisa melampaui pendapatan sektor unggulan lain. Hal tersebut belum seperti di daerah. Pendapatan daerah dan penciptaan lapangan pekerjaan belum berbanding lurus,&rdquo; papar Rifli Katili.</p>\r\n\r\n<p>Sementara itu dalam laporan kegiatan, Sekretaris Dinas Sofyan J Puloo menjelaskan tujuan dilaksanakannya kegiatan ini adalah sarana untuk mengevaluasi program yang telah dilaksanakan pada tahun anggaran 2019, menyelaraskan program dan kegiatan urusan pariwisata antarkabupaten/Kota dalam rangka sinergi pelaksanaan dan optimalisasi pencapaian sasaran di tahun 2020.</p>\r\n\r\n<p>&ldquo;Hasil yang diharapkan kegiatan ini adalah sinergitas pelaksanaan program melalui pendekatan yang holistik, tematik, terintegrasi dan spasial di tahun ini,&rdquo; kata Sofyan J Puloo.</p>\r\n\r\n<p>Sumber : www.gorontaloprov.go.id</p>\r\n', 'Minggu', '2017-11-19', '22:25:08', '378b7fa4830dc6bb267cf4027bf03a3fe6_XL.jpg', 1, ''),
(153, 2, 'admin', 'Dinas pariwisata Berhasil Jalin Kesepakatan Pengembangan Pariwisata Destinasi dan Ekraf', 'dinas-pariwisata-berhasil-jalin-kesepakatan-pengembangan-pariwisata-destinasi-dan-ekraf', '<p>GORONTALO &ndash; Kesepakatan menjalin sinergi antar dinas pariwisata kabupaten/kota ditandatangani usai rapat koordinasi awal tahun dalam rangka evaluasi &nbsp;program tahun anggaran 2019 dan sinkronisasi program tahun 2020 di aula Dinas Partiwisata Provinsi Gorontalo, Kamis (23/1/2020).</p>\r\n\r\n<p>Kesepakatan ini berisi 3 program pariwisata yang meliputi pengembangan pemasaran pariwisata, destinasi dan ekonomi kreatif.</p>\r\n\r\n<p>Secara detail kesepakatan dalam program pengembangan pemasaran pariwisata meliputi kerja sama pembuatan paket wisata dan integrasi Calendar of Event (CoE), pemuatan berita pariwisata di media online dengan kabupaten/Kota, pengisian konten untuk videotron bandara, zonasi dan segmentasi pasar wisatawan per jenis wisata untuk proporsi wisata minat khusus dan mass tourism, pelatihan &nbsp;(ToT) digital promotion, baseline data untuk kepentingan Geopark, pemutakhiran data kunjungan wisata, dan pembentukan kelompok kerja (Pokja) pariwisata yang melibatkan kabupaten/kota.</p>\r\n\r\n<p>Sementara itu kesepakatan program pengembangan destinasi antara lain koordinasi dan komunikasi Dana Alokasi Khusus (DAK), fokus atraksi di destinasi wisata, usulan Kawasan Strategis Pariiwsata Nasional (KSPN) Boalemo &ndash; Pohuwato dan Kabupaten Gorontalo Utara, koordinasi usulan DAK fisik dan nonfisik, pembentukan dan penyegaran Pokdarwis melalui SK bupati/walikota, pendataan aset destinasi, pendataan destinasi terbarukan, dan pemutakhiran data per triwulan jumlah kunjungan wisatawan, lama tinggal dan jasa usaha pariwisata.</p>\r\n\r\n<p>Untuk kesepakatan program pengembangan ekonomi kreatif meliputi penyiapan ruang kreatif di kabupaten/kota, kerjasama kegiatan ekonomi kreatif, peningkatan SDM di lokasi destinasi, penguatan kelembagaan industri pariwisata, pemanfaatan galery untuk produk ekonomi kreatif di lokasi obyek wisata.</p>\r\n\r\n<p>&ldquo;Kami mengajak dinas pariwisata kabupaten/kota untuk bersinergi dengan mitra di industri pariwisata. Saat dinas pariwisata menyelenggarakan kegiatan maka mereka akan jalan dengan paket wisatanya,&rdquo; kata Rifli Katili usai penandatangan kesepakatan.</p>\r\n\r\n<p>Terobosan Dinas Pariwisata Provinsi Gorontalo yang menggandeng mitra di kabupaten/kota ini akan menjadi energy besar dalam pengelolaan sector pariwisata. Sinergi ini diharapkan akan melahirkan multiplier effect yang mampu meningkatkan pertunbuhan ekonomi, pemerataan pendapatan, dan pengurangan kemiskinan di pelosok Gorontalo.</p>\r\n\r\n<p>Dalam pertemuan ini, Sekreatris Dinas Sofyan J Puloo menjelaskan hasil yang diharapkan adalah sinergitas pelaksanaan program melalui pendekatan yang holistik, tematik, terintegrasi dan spasial di tahun ini.</p>\r\n\r\n<p>Sumber : www.gorontaloprov.go.id</p>\r\n', 'Minggu', '2017-11-19', '22:27:50', '54c52e4b23e75ec27253444e795c47ca64_XL.jpg', 1, ''),
(154, 2, 'admin', 'Jelajah Sulawesi 2020 Akan Memperkuat Brand Pariwisata Gorontalo', 'jelajah-sulawesi-2020-akan-memperkuat-brand-pariwisata-gorontalo', '<p>GORONTALO &ndash; Persiapan Touring Jelajah Sulawesi 2020 semakin dimatangkan oleh Pemerintah Provinsi Gorontalo dengan menggelar rapat yang dipimpin Sekretaris Daera, Darda Daraba, Jumat (24/1/2020).</p>\r\n\r\n<p>Rapat ini juga dihadiri Ketua Panitia Asisten 1, Sukri Botutihe dan Kepala Dinas Pariwisata, Rifli M Katili. Agenda akbar pariwisata Pemerintah Provinsi Gorontalo ini akan melibatkan penggemar otomotif dari seluruh Indonesia. Mereka akan menjajal medan darat dari kota ke kota di Pulau Sulawesi.</p>\r\n\r\n<p>Jelajah Sulawesi 2020 ini akan dilaksanakan pada 22-29 Februari dengan mengambil titik start di Kota Makassar, Sulawesi Selatan. Dari kota terbesar di Sulawesi ini rombongan penggemar otomotif ini akan menjelajah kota-kota di sepanjang jalan yang menawarkan pesona keindahan alam dan budaya seperti Parepare-Toraja, Poso, Parigi Moutong, Gorontalo hingga berakhir di Kota Manado, Sulawesi Utara.</p>\r\n\r\n<p>&ldquo;Rapat yang dihadiri oleh semua Kepala Organisasi Perangkat Daerah (OPD) ini membahas persiapan dan kebutuhan teknis kegiatan acara yang akan membutuhkan waktu kurang lebih 8 hari,&rdquo; kata Rifli Katili.</p>\r\n\r\n<p>Pemerintah Provinsi Gorontalo secara aktif mempromosikan kegiatan kepariwisataan yang dapat menguatkan narasi kota-kota yang disinggahi, brand pariwisata pulau Sulawesi semakin berkibar di pentas nasional bahkan internasional.</p>\r\n\r\n<p>Jelajah Sulawesi 2020 ini akan menawarkan keindahan alam Sulawesi yang menjadi incaran banyak wisatawan dunia, alamnya yang unik karena berada di kawasan Wallacea memberi transfer pengetahuan bagi wistaawan, demikian juga kebudayaannya yang beragam akan menambah kepuasan wisatawan.</p>\r\n\r\n<p>Rifli Katili yakin dengan digelarnya Jelajah Sulawesi ini akan semakin membuka ruang bagi wisatawan yang datang ke daerah ini, kegiatan ini juga akan memperkuat branding Gorontalo sebagai daerah tujuan utama pariwisata di Sulawesi.</p>\r\n\r\n<p>&ldquo;Gorontalo memiliki kekayaan alam dan budaya yang berlimpah, menawarkan pesona yang tidak akan terlupakan oleh wisatawan. Silakan datang ke Gorontalo, nikmati semua atraksinya,&rdquo; ujar Rifli Katili</p>\r\n\r\n<p>Sumber : www.gorontaloprov.go.id</p>\r\n', 'Sabtu', '2020-01-25', '22:37:03', '740adf0928e9d06913a64e0c849c233518_XL.jpg', 1, '');
